import React from "react";
import "primeicons/primeicons.css";
import "primereact/resources/primereact.min.css";
import { Card } from "primereact/card";
import { Button } from "primereact/button";

const header = (
  <img
    alt="Card"
    src="showcase/demo/images/usercard.png"
    onError={(e) =>
      (e.target.src =
        "https://www.primefaces.org/wp-content/uploads/2020/05/placeholder.png")
    }
  />
);
const footer = (
  <span>
    <Button label="Save" icon="pi pi-check" />
    <Button
      label="Cancel"
      icon="pi pi-times"
      className="p-button-secondary p-ml-2"
    />
  </span>
);

const Intro = () => {
  return (
    <div className="p-d-flex p-jc-center p-ai-center p-flex-column">
      <div className="p-mb-2">
        This Web-App is created by
        <h2 className="p-px-2" style={{ fontFamily: "Montserrat" }}>
          Suryansh Chauhan
        </h2>
      </div>
      <div className="p-mb-2">
        This is a Molecule Viewer that allows the user to search for the
        structure of more than{" "}
        <h2 className="p-px-2" style={{ fontFamily: "Montserrat" }}>
          100 million compounds
        </h2>
      </div>
      <div className="p-d-flex">
        <Card
          title="Advanced Card"
          subTitle="Subtitle"
          style={{ width: "25em" }}
          footer={footer}
          header={header}
        >
          <p className="p-m-0" style={{ lineHeight: "1.5" }}>
            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Inventore
            sed consequuntur error repudiandae numquam deserunt quisquam
            repellat libero asperiores earum nam nobis, culpa ratione quam
            perferendis esse, cupiditate neque quas!
          </p>
        </Card>
      </div>
    </div>
  );
};

export default Intro;
